"use client";

import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { motion } from "framer-motion";
import { ArrowLeft, Clock, Info } from "lucide-react";
import Link from "next/link";

interface Pokemon {
  id: number;
  name: string;
  imageUrl: string;
  description: string;
  type: string;
  height: string;
  weight: string;
  abilities: string[];
  evolution: string;
  history: string;
}

const History = () => {
  const { id } = useParams<{ id: string }>();
  const [pokemon, setPokemon] = useState<Pokemon | null>(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchPokemonData = async () => {
      // In a real application, you would fetch this data from an API
      // For this example, we'll use the data provided in the prompt
      const mockData: Pokemon = {
        id: 1,
        name: "Iron Bundle",
        imageUrl: "/img/iron-bundle.png",
        description:
          "Iron Bundle is a futuristic Pokémon with powerful Ice and Water abilities.",
        type: "Ice/Water",
        height: "1.5 m",
        weight: "85 kg",
        abilities: ["Quark Drive"],
        evolution: "N/A",
        history:
          "Iron Bundle emerged as a groundbreaking discovery in the Paldea region, representing a unique fusion of technological innovation and biological evolution. Developed by the Pokémon Research Team at the Naranja/Uva Academy, this Pokémon is part of the enigmatic Iron Hands series, a group of artificial or technologically enhanced creatures that blur the lines between natural Pokémon and advanced robotics. Its origins can be traced back to experimental research exploring the integration of quantum-like energetic properties with traditional Pokémon physiology. The creature's distinctive Quark Drive ability suggests a deep connection to cutting-edge scientific understanding, allowing it to adapt and generate extraordinary energy patterns that defy conventional Pokémon capabilities. Unlike traditional Ice and Water-type Pokémon, Iron Bundle represents a new frontier of Pokémon development, embodying the potential for artificial intelligence and biological engineering to create entirely new forms of life. Researchers are particularly fascinated by its unique morphology, which combines sleek, mechanical elements with organic characteristics, making it a subject of intense study in the fields of Pokémon biology, quantum mechanics, and artificial intelligence. Its discovery has sparked widespread debate about the nature of Pokémon existence and the ethical implications of creating such technologically advanced living beings.",
      };

      setPokemon(mockData);
      setLoading(false);
    };

    fetchPokemonData();
  }, [id]);

  if (loading) {
    return (
      <div className="flex items-center justify-center h-screen">
        <div className="animate-spin rounded-full h-32 w-32 border-t-2 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  if (!pokemon) {
    return <div className="text-center text-2xl mt-10">Pokémon not found</div>;
  }

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-100 to-indigo-200 p-8">
      <Link
        href="/"
        className="inline-flex items-center text-blue-600 hover:text-blue-800 mb-6"
      >
        <ArrowLeft className="mr-2" />
        Back to Pokédex
      </Link>
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
        className="max-w-4xl mx-auto bg-white rounded-lg shadow-xl overflow-hidden"
      >
        <div className="md:flex">
          <div className="md:flex-shrink-0">
            <img
              className="h-48 w-full object-cover md:w-48"
              src={pokemon.imageUrl}
              alt={pokemon.name}
            />
          </div>
          <div className="p-8">
            <div className="uppercase tracking-wide text-sm text-indigo-500 font-semibold">
              {pokemon.type}
            </div>
            <h1 className="mt-1 text-4xl font-bold text-gray-900">
              {pokemon.name}
            </h1>
            <p className="mt-2 text-gray-600">{pokemon.description}</p>
          </div>
        </div>
        <div className="px-8 py-6 bg-gray-50">
          <h2 className="text-2xl font-bold text-gray-800 mb-4 flex items-center">
            <Clock className="mr-2" />
            Historical Background
          </h2>
          <motion.p
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.3, duration: 0.5 }}
            className="text-gray-700 leading-relaxed"
          >
            {pokemon.history}
          </motion.p>
        </div>
        <div className="px-8 py-6">
          <h3 className="text-xl font-semibold text-gray-800 mb-3 flex items-center">
            <Info className="mr-2" />
            Additional Information
          </h3>
          <ul className="grid grid-cols-2 gap-4">
            <li className="text-gray-600">
              <span className="font-medium">Height:</span> {pokemon.height}
            </li>
            <li className="text-gray-600">
              <span className="font-medium">Weight:</span> {pokemon.weight}
            </li>
            <li className="text-gray-600">
              <span className="font-medium">Abilities:</span>{" "}
              {pokemon.abilities.join(", ")}
            </li>
            <li className="text-gray-600">
              <span className="font-medium">Evolution:</span>{" "}
              {pokemon.evolution}
            </li>
          </ul>
        </div>
      </motion.div>
    </div>
  );
};

export default History;
